import React from "react";
import { Box, Image } from "@chakra-ui/core";

const CheckIn = () => {
  return (
    <Box>
      <Image
        src={require("assets/images/check-in.png")}
        height="auto"
        w="auto"
      />
    </Box>
  );
};

export default CheckIn;
